<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">

    <link rel="stylesheet" href="<%= BASE_URL %>css/sb-admin-2.min.css">
    <link rel="stylesheet" href="<%= BASE_URL %>css/all.min.css">

      rel="stylesheet"
